import axios from "axios";

const REST_API_URL = 'http://localhost:8080/products';

export async function getProducts(page = 0, pageSize = 2) {
    return await axios.get(`${REST_API_URL}?page=${page}&pageSize=${pageSize}`);
}

export async function getProduct(id) {
    return await axios.get(`${REST_API_URL}/${id}`);
}

export async function addProduct(product) {
    return await axios.post(REST_API_URL, product);
}

export async function udpateProduct(product) {
    return await axios.post(REST_API_URL, product);
}
